  return (
    <section id="certificates" className="section">
      <h2>Certificates</h2>
      <div className="certificate-box">
        <ul>
          <li><a href="https://coursera.org/share/7e8c598e789e573eb7cc9e5522f5bc08" target="_blank" rel="noopener noreferrer">Certificate 1</a></li>
          <li><a href="https://coursera.org/share/66e28615ab1fe5727d31fcd5b378af10" target="_blank" rel="noopener noreferrer">Certificate 2</a></li>
          <li><a href="https://coursera.org/share/97cb17155defee45eb4a1159eeb44554" target="_blank" rel="noopener noreferrer">Certificate 3</a></li>
          <li><a href="https://coursera.org/share/451e3d477bc4895a81ce1ef3cd25ca43" target="_blank" rel="noopener noreferrer">Certificate 4</a></li>
        </ul>
      </div>
    </section>
  );
};

export default Certificates;
